var barWidth = maxLength * 7;
var numBars = Math.round(width / barWidth);
var isScrollDisplayed = barWidth * data.length > width;

var xscale = d3.scale.ordinal()
.domain(data.slice(0,numBars).map(function (d) { return d.name; }))
.rangeBands([0, width], .06)
var yscale = d3.scale.linear()
.domain([-0.3, 1,  d3.max(data, function (d) { return d.Value; })])
.range([height, 0]);
var xAxis  = d3.svg.axis().scale(xscale).orient("bottom");
var yAxis  = d3.svg.axis().scale(yscale).orient("left").tickFormat(function(d) {return d + "%"});;

var Tooltip = d3.select("#bar_chart")
.append("div")
.style("opacity", 0)
.attr("class", "tooltip")

var mouseover = function(d) {
Tooltip
.style("opacity", 1)
d3.select(this)
.style("opacity", 1)
}
var mousemove = function(d) {
Tooltip
.text(d.name + ":" + d.Value + "%")
.style("left", (d3.mouse(this)[0]+30) + "px")
.style("top", (d3.mouse(this)[1]) + "px")
.style("font-weight", "600")
}
var mouseleave = function(d) {
Tooltip
.style("opacity", 0)
d3.select(this)
}
	
var svg = d3.select("#bar_chart").append("svg")
.attr("width", width + margin.left + margin.right)
.attr("height", height + margin.top + margin.bottom + selectorHeight)
.append("g")
.attr("transform", "translate(" + margin.left + "," + margin.top + ")");

var diagram = svg.append("g")
 bars = diagram.append("g"); 
bars.selectAll("g")
.data(data.slice(0, numBars), function (d) {return d.name; })
.enter().append("rect")
.attr("class", "extent")
.attr("x", function (d) { return xscale(d.name); })
.attr("y", function (d) { return yscale(d.Value); })
.attr("width", xscale.rangeBand())
.attr("height", function (d) { return height - yscale(d.Value); })
.attr("class", function(d) {
if (d.Value < 0){
	return "negative";
} else {
	return "positive";
}}) 
.attr("data-yr", function(d){
return d.name;
})
.attr("data-c", function(d){
return d.Value;
})
.attr("title", function(d){
return (d.name + ": " + d.Value + " %")
})
.attr("y", function(d) {

if (d.Value > 0){
	return yscale(d.Value);
} else {
	return yscale(0);
}
})
.attr("x", function(d) {
return xscale(d.name);
})
.attr("width", xscale.rangeBand())

.attr("height", function(d) {
return Math.abs(yscale(d.Value) - yscale(0));
})


.on("mouseover", mouseover)
.on("mousemove", mousemove) 
.on("mouseleave", mouseleave)

  
  
var diagram = svg.append("g")               
diagram.append("g")
.attr("class", "x axis")
.attr("transform", "translate(0, " + height + ")")
.call(xAxis);

diagram.append("g")
.attr("class", "y axis")  
.call(yAxis);
	
if (isScrollDisplayed)
{
  var xOverview = d3.scale.ordinal()
  .domain(data.map(function (d) { return d.name; }))
  .rangeBands([0, width], .2);
  yOverview = d3.scale.linear().range([heightOverview, 0]);
  yOverview.domain(yscale.domain());
  var subBars = diagram.selectAll('path')
  .data(data)
  subBars.enter().append("rect")
.attr("class", function(d) {
if (d.Value < 0){
return "negative";
} else {
return "positive";
}})
.attr("width", xscale.rangeBand())
.attr("height", function(d) {
return Math.abs(yscale(d.Value) - yscale(0));
})
.attr({
width: function(d) {
return xOverview.rangeBand()
},
x: function(d) {
return xOverview(d.name);
},
y: function(d) {
return height + heightOverview + yOverview(d.Value)
}
})

var displayed = d3.scale.quantize()
.domain([0, width])
.range(d3.range(data.length));
diagram.append("rect")
.attr("transform", "translate(0, " + (height + margin.bottom) + ")")
.attr("class", "mover")
.attr("x", 0)
.attr("y", 0)
.attr("height", selectorHeight)
.attr("width", Math.round(parseFloat(numBars * width )/data.length))
.attr("pointer-events", "all")
.attr("cursor", "ew-resize")
.call(d3.behavior.drag().on("drag", display))
}
function display () {
var x = parseInt(d3.select(this).attr("x")),
nx = x + d3.event.dx,
w = parseInt(d3.select(this).attr("width")),
f, nf, new_data, rects;
if ( nx < 0 || nx + w > width ) return;
d3.select(this).attr("x", nx);
f = displayed(x);
nf = displayed(nx);
if ( f === nf ) return;
new_data = data.slice(nf, nf + numBars);
xscale.domain(new_data.map(function (d) { return d.name; }));
diagram.select(".x.axis").call(xAxis);
rects = bars.selectAll("rect")
.data(new_data, function (d) {return d.name; });
rects.attr("x", function (d) { return xscale(d.name); });
rects.enter().append("rect")

.attr("width", xscale.rangeBand())
.attr("height", function (d) { return height - yscale(d.Value); })
.attr("class", function(d) {
if (d.Value < 0){
return "negative";
} else {
return "positive";
}}) 

.attr("y", function(d) {

if (d.Value > 0){
return yscale(d.Value);
} else {
return yscale(0);
}
})


.attr("x", function(d) {
return xscale(d.name);
})
.attr("width", xscale.rangeBand())

.attr("height", function(d) {
return Math.abs(yscale(d.Value) - yscale(0));
})

.on("mouseover", mouseover)
.on("mousemove", mousemove)
.on("mouseleave", mouseleave)
rects.exit().remove();
};

</script>

    border-radius: 3px;
    margin-top: -30px;
    font: 10px sans-serif;
    background: #32323e;
    color: #FFFF4C;

    fill: white;
    stroke: #000;

.tooltip {
  fill: white;
  stroke: #000;

  font-weight: bold;
